import axios from 'axios';
import {
  WorkComponent,
  WorkTitle,
  SpanH2,
  Part,
  Icon,
  PartTitle,
  Line,
  PartDesc
} from "./style.js";

class Work extends Component {
  state = {
    works :[]
  }
  componentDidMount(){
    axios.get('data.json').then(res => {
      this.setState({
        works : res.data.works
      })
    })
  }

  render() {
    const wors = this.state


    return (
      <div>
        <WorkComponent>
          <div className="container">
            <WorkTitle>
              <SpanH2>My</SpanH2> Work
            </WorkTitle>
            <Part first={true}>
              <Icon className="icon fa fa-chain fa-2x"></Icon>
              <PartTitle>Mobile Ux</PartTitle>
              <Line />
              <PartDesc>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit.
                Doloribus quos omnis voluptas ea ipsam! Voluptas.
              </PartDesc>
            </Part>
            <Part>
              <Icon className="icon fa fa-bolt fa-2x"></Icon>
              <PartTitle>Mobile Ux</PartTitle>
              <Line />
              <PartDesc>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit.
                Doloribus quos omnis voluptas ea ipsam! Voluptas.
              </PartDesc>
            </Part>

            <Part last={true}>
              <Icon className="icon fa fa-tachometer fa-2x"></Icon>
              <PartTitle>Mobile Ux</PartTitle>
              <Line />
              <PartDesc>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit.
                Doloribus quos omnis voluptas ea ipsam! Voluptas.
              </PartDesc>
            </Part>
          </div>
        </WorkComponent>
      </div>
    );
  }
}

export default Work;
